import { Card, Text } from "@nextui-org/react";

export default function Inicio() {

  return (
    <div style={{display:"flex",justifyContent:"center",alingContent:"center"}}>
       <Card css={{ mw: "400px" }}>
      <Card.Body>
        <Text>A basic card</Text>
        <Input labelPlaceholder="NextUI" />
      </Card.Body>
    </Card>

    </div>
  );
}
